We are hosting a weekly event for people who enjoy taking gaming screenshots. Every Monday, we come up with a new topic. By Sunday, we will give Shoutouts on our stories to our personal favorites.

This weeks' topic is “ARCHITECTURE”

So here’s my submission to this weeks theme...West of Loathing

Rules: - Only self-made Screenshots are allowed
- The weekly theme should be the focus of the screenshots' composition
- Use #weekofscreens, so we can find your submissions
- tag us hosts in the screenshot and refer to the event in the description

